local MarkerZoneCreated = {}
function CreateVehicleNodeMarker(zone)
	if(getServerPort() == 22013) then
		if(not MarkerZoneCreated[zone]) then
			MarkerZoneCreated[zone] = true
			if(PathNodes[zone]) then
				triggerClientEvent(source, "InfoPath", source, zone, toJSON(PathNodes[zone]))
			end
		end
	end
end
addEvent("CreateVehicleNodeMarker", true)
addEventHandler("CreateVehicleNodeMarker", root, CreateVehicleNodeMarker)




function table.copy(t)
	local t2 = {};
	for k,v in pairs(t) do
		if type(v) == "table" then
			t2[k] = table.copy(v);
		else
			t2[k] = v;
		end
	end
	return t2;
end


function NEWGPSFound(x,y,z, x2,y2,z2)
	local startzone = getZoneName(x,y,z)
	local endzone = getZoneName(x2,y2,z2)
	if(PathNodes[startzone] and PathNodes[endzone]) then
		local tmp = {
			["startdist"] = {[1] = 9999, [2] = 9999, [3] = 9999, [4] = 9999}, 
			["enddist"] = {[1] = 9999, [2] = 9999, [3] = 9999, [4] = 9999}, 
			["tmpdist"] = 9999, 
			["startnode"] = {},
			["endnode"] = {},
			["nextnodes"] = {}, 
			["threads"] = {}, 
			["usablepaths"] = {[startzone] = {}}
		}
		for count = 1, 4 do
			for i,k in pairs(PathNodes[startzone]) do
				local double = false
				for _, b in pairs(tmp["startnode"]) do
					if(b == i) then
						double = true 
					end
				end
				if(not double) then
					tmp["tmpdist"] = getDistanceBetweenPoints2D(x, y, k[2], k[3])
					if(tmp["tmpdist"] < tmp["startdist"][count]) then
						tmp["startdist"][count] = tmp["tmpdist"]
						tmp["startnode"][count] = i
					end
				end
			end
		end
		
		for count = 1, 4 do
			for i,k in pairs(PathNodes[endzone]) do
				local double = false
				for _, b in pairs(tmp["endnode"]) do
					if(b == i) then
						double = true 
					end
				end
				if(not double) then
					tmp["tmpdist"] = getDistanceBetweenPoints2D(x2, y2, k[2], k[3])
					if(tmp["tmpdist"] < tmp["enddist"][count]) then
						tmp["enddist"][count] = tmp["tmpdist"]
						tmp["endnode"][count] = i
					end
				end
			end
		end
		
		for i, v in pairs(tmp["startnode"]) do
			tmp["nextnodes"][i] = {startzone, v, i, {[1] = i}}
			tmp["threads"][i] = {}
		end
		
		for is = 1, 20000 do
			for i, arr in pairs(tmp["nextnodes"]) do
				if(not tmp["usablepaths"][arr[1]]) then 
					tmp["usablepaths"][arr[1]] = {}
				end
				
				if(tmp["usablepaths"][arr[1]][arr[2]]) then -- Если попали в петлю
				--	tmp["threads"][arr[3]] = nil
					tmp["nextnodes"][i] = nil
				else
					tmp["usablepaths"][arr[1]][arr[2]] = true
					
				
					if(PathNodes[arr[1]][arr[2]][6]) then
						for i2, k2 in pairs(PathNodes[arr[1]][arr[2]][6]) do
							table.insert(tmp["threads"], {})
							local newarr = table.copy(arr[4])
							table.insert(newarr, #tmp["threads"])
							table.insert(tmp["nextnodes"], {k2[1], k2[2], #tmp["threads"], newarr})
						end
					else
						table.insert(tmp["threads"][arr[3]], {PathNodes[arr[1]][arr[2]][2], PathNodes[arr[1]][arr[2]][3], PathNodes[arr[1]][arr[2]][4]})
						tmp["nextnodes"][i] = {arr[1], arr[2]+1, arr[3], arr[4]}
					end
					
					
					
					for _, node in pairs(tmp["endnode"]) do
						if(arr[1] == endzone and arr[2] == node) then
							local out = {}
							for _, id in pairs(arr[4]) do
								for _, el in pairs(tmp["threads"][id]) do
									table.insert(out, el)
								end
							end
							--outputChatBox("Готово! "..arr[1].." "..arr[2].." Размер пути: "
							--..#out.." Всего потоков: "..#tmp["threads"].." Количество потоков:"..#arr[4])
							return out
						end
					end
				end
			end
		end
	end
	return false
end




function GetPathByCoordsNEW(thePlayer, gx,gy,gz,gx2,gy2,gz2)
	local arr = NEWGPSFound(gx,gy,gz,gx2,gy2,gz2)
	if(arr) then
		triggerClientEvent(thePlayer, "SetGPS", thePlayer, toJSON(arr))
		return true
	else
		ToolTip(thePlayer, "GPS: Невозможно найти путь!")
	end
	return false
end
addEvent("GetPathByCoordsNEW", true)
addEventHandler("GetPathByCoordsNEW", root, GetPathByCoordsNEW)





